// Ajoutez le 'from' ici
import styles from './header.module.css';
import logo from './logo .png';  // Supprimez l'espace inutile dans le nom du fichier

const Header= () => {

  return (
    <header className={styles.header}>
      <div className={styles.logoContainer}>
        <img src={logo} alt="Logo" className={styles.logo} />
      </div>
      <nav className={styles.navbar}>
        <ul className={styles.navList}>
          <li className={styles.navItem}><Link>Accueil</Link></li>
          <li className={styles.navItem}><a href="#presentation"><Link>Accueil</Link>Pr√©sentation</a></li>
          <li className={styles.navItem}><a href="#consulter"><Link>Accueil</Link>Consulter</a></li>
          <li className={styles.navItem}><a href="#organizer"><Link>Accueil</Link>Organiser</a></li>
          <li className={styles.navItem}><a href="#profil"><Link>Accueil</Link>Profil</a></li>
          <li className={styles.navItem}><a href="#contact"><Link>Accueil</Link>Contact</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
